const OrderDetails = () => {
    return (
        <div className="px-5 lg:px-20">
            <div>
                <h1 className="font-semibold text-lg">Delivery Address</h1>
                <AddressCard/>
            </div>
        </div>
    );
}

export default OrderDetails;
